import React, { Component } from 'react'

//components

class contact extends Component {
    render() {
        return (
            <div className="contact">
                <h1 style={{textAlign:"center"}}>Contact</h1>
                <h3>Complaints</h3>
                <p>If you have complaints regarding the way your protected health information was handled, you may submit a complaint in writing to our office. You will not be retaliated against in any manner for a complaint.</p>
            </div>
        )
    }
}

export default contact
